import React from 'react';

class WireFrameDelete extends React.Component {

    render() {
        const { wireFrame } = this.props;
        console.log("WireFrameCard, wireframe.id: " + wireFrame.id);
        return (
            <div className="col s8 center-align">
            <div style={{padding: 0}}className="center-align  z-depth-2 rounded grey lighten-4 todo-list-link hoverable">
            <div style={{margin: 0}}className=" center-align grey-text text-darken-4 item_card">
                <a  href="#modal1" className="material-icons center-align card-title grey-text">delete</a>
            </div>
        </div>
        <div id="modal1" className="modal"></div>
        </div>
        );
    }
}
export default WireFrameDelete;
